  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Arrowwood
  Water Management District outlines District accomplishments during the 1981 calendar
  year. The report begins by summarizing the weather conditions and water conditions
  during the year. Wildlife- including migratory birds, upland game birds, big game
  animals, furbearers, predators, and raptors- is also covered. The District development
  and maintenance section discusses physical developments, prescribed burns, and wildfires.
  Resource management is outlined; topics include grazing. A progress report on field
  investigations and applied research is also provided. The public relations section
  of the report discusses hunting. Items of interest and photographs are attached.\",\n\t\"license_title\":
